import React from 'react';
import dexv2 from './dexv2.svg';
import './App.css';
import NavBar from './NavBar';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={dexv2} className="App-logo" alt="logo" />
        <NavBar></NavBar>
      </header>
      <div className="AppBody">
        <p>Pretend there is something here.</p>
      </div>
    </div>
  );
}

export default App;
